import React from 'react';

import Header from '../../components/01_sections/header/Header';
import RightFixed from '../../components/01_sections/rightFixed/RightFixed';

function AmaingPlanter() {
  return (
    <div height="500px">
      <Header />
      <RightFixed />
      <iframe
        src="https://noahsjung.com/works/amazing-planter"
        // style="border: 0"
        position="fixed"
        top="0"
        left="0"
        right="0"
        bottom="0"
        width="100%"
        height="1000px"
        title="a-mazing-planter"
      ></iframe>
    </div>
  );
}

export default AmaingPlanter;
